import React from 'react';
import './App.css';
import './SimpleChatbot-1.3.2/chatbot/chatbot.css'
import ChatBot from 'react-simple-chatbot';
 
const steps = [
    {
        id: '0',
        message: 'Hey Geek!',
        end: true
    }
];


function App (){
    return (
        <div className="App">
            <h1>Welcome to Geeksforgeeks</h1>
            <ChatBot steps={steps} />s
        </div>
    );
};

export default App;
